private function normalizeArgumentKeys(array $config) {  if (isset($config['arguments'])) {    $arguments = $config['arguments'];    $newArguments = array();    foreach ($arguments as $key => $value) {      if (strstr($key, '_')) {        $key = str_replace('_', '-', $key);      }      $newArguments[$key] = $value;    }    $config['arguments'] = $newArguments;  }  return $config;}